import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div style={{ fontFamily: "'Poppins', sans-serif" }}>
      
      {/* ---------- NAVBAR ---------- */}
      <nav style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        backgroundColor: '#062A01', // darker green
        padding: '15px 50px',
        color: 'white',
        boxShadow: '0 2px 5px rgba(0,0,0,0.3)',
        position: 'sticky',
        top: 0,
        zIndex: 1000
      }}>
        <h2 style={{ margin: 0 }}>Aptitude Preparation</h2>
        <button 
          style={{
            backgroundColor: 'white',
            color: '#062A01',
            border: 'none',
            padding: '8px 18px',
            borderRadius: '5px',
            cursor: 'pointer',
            fontWeight: 'bold'
          }}
        >
          Login
        </button>
      </nav>

      {/* ---------- INTRO SECTION ---------- */}
      <section style={{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        padding: '60px 100px',
        backgroundColor: '#F4F7F4'
      }}>
        <img 
          src="/home.jpg" 
          alt="Aptitude Preparation" 
          style={{
            width: '350px',
            borderRadius: '10px',
            marginRight: '50px',
            boxShadow: '0 4px 10px rgba(0,0,0,0.3)'
          }}
        />
        <p style={{
          fontSize: '22px',
          lineHeight: '1.8',
          color: '#222',
          maxWidth: '550px',
          textAlign: 'justify',
          fontFamily: "'Segoe UI', sans-serif"
        }}>
          Welcome to the <b>Aptitude Preparation</b> platform!  
          Here, you can sharpen your reasoning, quantitative, and verbal skills 
          through well-structured practice sets.  
          Prepare confidently for your placement exams and boost your problem-solving 
          potential with focused learning.
        </p>
      </section>

      {/* ---------- SYLLABUS SECTION ---------- */}
      <section style={{ 
        padding: '50px 100px', 
        textAlign: 'center',
        backgroundColor: '#0B3D02',
        position: 'relative'
      }}>
        <h2 style={{ color: 'white', marginBottom: '40px' }}>Syllabus</h2>
        
        <div style={{
          display: 'flex',
          justifyContent: 'center',
          gap: '40px',
          flexWrap: 'wrap'
        }}>
          {[
            { title: "Reasoning", topics: ["Puzzles", "Series", "Blood Relations", "Seating Arrangement"] },
            { title: "Quantitative", topics: ["Arithmetic", "Algebra", "Geometry", "Data Interpretation"] },
            { title: "Verbal", topics: ["Grammar", "Comprehension", "Vocabulary", "Synonyms & Antonyms"] },
          ].map((card, index) => (
            <div 
              key={index}
              style={{
                backgroundColor: '#145A32',
                width: '250px',
                padding: '30px',
                borderRadius: '10px',
                boxShadow: '0 4px 10px rgba(0,0,0,0.3)',
                color: 'white',
                fontWeight: 'bold',
                fontSize: '20px',
                position: 'relative',
                cursor: 'pointer',
                transition: 'transform 0.3s, box-shadow 0.3s',
                overflow: 'hidden'
              }}
              className="card"
              onMouseEnter={(e) => {
                e.currentTarget.style.transform = 'scale(1.05)';
                const dropdown = e.currentTarget.querySelector('.dropdown');
                dropdown.style.maxHeight = '200px';
                dropdown.style.opacity = '1';
              }}
              onMouseLeave={(e) => {
                e.currentTarget.style.transform = 'scale(1)';
                const dropdown = e.currentTarget.querySelector('.dropdown');
                dropdown.style.maxHeight = '0';
                dropdown.style.opacity = '0';
              }}
            >
              {card.title}

              {/* Dropdown section */}
              <div 
                className="dropdown"
                style={{
                  marginTop: '15px',
                  backgroundColor: '#0B3D02',
                  borderRadius: '8px',
                  transition: 'all 0.4s ease',
                  maxHeight: '0',
                  opacity: '0',
                  overflow: 'hidden',
                  padding: '0 10px'
                }}
              >
                <ul style={{
                  listStyle: 'none',
                  padding: 0,
                  margin: 0,
                  textAlign: 'left'
                }}>
                  {card.topics.map((topic, i) => (
                    <li key={i} style={{
                      padding: '8px 0',
                      fontSize: '16px',
                      borderBottom: i !== card.topics.length - 1 ? '1px solid rgba(255,255,255,0.2)' : 'none'
                    }}>
                      {topic}
                    </li>
                  ))}
                </ul>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* ---------- FOOTER ---------- */}
      <footer style={{
        backgroundColor: '#062A01',
        color: 'white',
        textAlign: 'center',
        padding: '20px',
        marginTop: '0'
      }}>
        <p style={{ margin: 0 }}>Â© 2025 Aptitude Preparation | Designed by Shamal</p>
      </footer>
    </div>
  );
};

export default Home;
